class SeftTests(unittest.TestCase):

    def test_encrypt_transfer_decrypt(self):

        jwt = QUEUE_MESSAGE

        decrypter = Decrypter(PUBLIC_ENCRYPTION_KEY,
                              SDX_PRIVATE_KEY,
                              PRIVATE_SIGNING_KEY_PASSWORD)

        decrypted_payload = decrypter.decrypt(jwt)
        print(decrypted_payload)

        file_contents = decrypted_payload.get("file")
        file_name = decrypted_payload.get("file_name")
        self.assertEquals("question.xls", file_name)
        print(file_contents)
        decoded_contents = base64.b64decode(file_contents)

        with open("./test_files/"+file_name, "wb") as fb:
            fb.write(decoded_contents)
